import React, { Component } from "react"

export default class NewDoctorForm extends Component {
    state = {
        name: "",
        location: ""
    }

    handleFieldChange = evt => {
        const stateToChange = {};
        stateToChange[evt.target.id] = evt.target.value;
        this.setState(stateToChange)
    }

    render() {
        return (
            <>
            Add New Doctor Here!
            </>
        )
    }
}
